import React, { Component } from 'react'
import { template } from '@babel/core';

export default class App extends Component {

    showTemplate() {
        console.log();
    }

    componentDidMount() {

        var template = document.getElementById("template");
        console.log(template);

        document.getElementById("panal").html(template);

    }

    render() {
        const styles = {
            followme: {
                width: '15%',
                padding: '10px'
            },
            a: { backgroundColor: 'grey', color: '#fff', padding: 10, marginRight: 5 }
        }
        return (
            <div>
                <div id="panal">...</div>
                <template  id="template">
                    <div style={styles.followme}>
                        <h3>Follow me</h3>
                        <a style={styles.a} href="https://www.facebook.com/siamhtml">facebook</a>
                        <a style={styles.a} href="https://twitter.com/SuranartN">twitter</a>
                    </div>
                </template>
            </div>
        )
    }
}

class Template extends Component {

    render() {
        const styles = {
            followme: {
                width: '15%',
                padding: '10px'
            },
            a: { backgroundColor: 'grey', color: '#fff', padding: 10, marginRight: 5 }
        }
        return (
            <div>
                <div style={styles.followme}>
                    <h3>Follow me</h3>
                    <a style={styles.a} href="https://www.facebook.com/siamhtml">facebook</a>
                    <a style={styles.a} href="https://twitter.com/SuranartN">twitter</a>
                </div>
            </div>
        )
    }
}
